# this function, given DNA and the resulting protein, finds which table the protein was translated with

def which_table(code):
    tables = [1, 2, 3, 4, 5, 6, 9, 10, 11, 12, 13, 14, 15]
    for item in tables:
        if translate(code,table=item, to_stop=True) == end:
            print (item)


